import React, { useState } from 'react';
import { AppBar, Toolbar, Typography, IconButton, Drawer, List, ListItem, ListItemIcon, ListItemText, Button, Menu, MenuItem, Box, Collapse } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircle from '@mui/icons-material/AccountCircle';
import HomeIcon from '@mui/icons-material/Home';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import ChatIcon from '@mui/icons-material/Chat';
import AnnouncementIcon from '@mui/icons-material/Announcement';
import PublicIcon from '@mui/icons-material/Public';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import MusicNoteIcon from '@mui/icons-material/MusicNote';
import EmailIcon from '@mui/icons-material/Email';
import TrafficIcon from '@mui/icons-material/Traffic';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const Layout = ({ children }) => {
    const [sidebarOpen, setSidebarOpen] = useState(true);
    const [anchorEl, setAnchorEl] = useState(null);
    const [topStocksMenu, setTopStocksMenu] = useState(null);
    const isMenuOpen = Boolean(anchorEl);
    const isTopStocksOpen = Boolean(topStocksMenu);

    const handleSidebarToggle = () => {
        setSidebarOpen(!sidebarOpen);
    };

    const handleProfileMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMenuClose = () => {
        setAnchorEl(null);
        setTopStocksMenu(null);
    };

    const handleTopStocksClick = (event) => {
        setTopStocksMenu(event.currentTarget);
    };

    const menuItems = [
        { text: 'Top Stocks', icon: <TrendingUpIcon />, onClick: handleTopStocksClick },
        { text: 'Data Bits', icon: <HomeIcon /> },
        { text: 'Reddit Mentions', icon: <ChatIcon /> },
        { text: 'News Mentions', icon: <AnnouncementIcon /> },
        { text: '4chan Mentions', icon: <PublicIcon /> },
        { text: 'Instagram Followers', icon: <ThumbUpIcon /> },
        { text: 'Facebook Followers', icon: <ThumbUpIcon /> },
        { text: 'TikTok Followers', icon: <MusicNoteIcon /> },
        { text: 'Threads Followers', icon: <EmailIcon /> },
        { text: 'Webpage Traffic', icon: <TrafficIcon /> }
    ];

    return (
        <Box sx={{ display: 'flex' }}>
            <AppBar position="static" sx={{ color: 'black', backgroundColor: '#fefee2', minHeight: '56px' }}>
                <Toolbar sx={{ minHeight: '56px' }}>
                    <IconButton
                        edge="start"
                        color="inherit"
                        aria-label="open drawer"
                        onClick={handleSidebarToggle}
                        sx={{ mr: 2 }}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" noWrap component="div" sx={{ flexGrow: 1, fontFamily: 'Arial', fontWeight: 'bold' }}>
                        AltIndex
                    </Typography>
                    <IconButton
                        edge="end"
                        aria-label="account of current user"
                        aria-haspopup="true"
                        onClick={handleProfileMenuOpen}
                        color="inherit"
                    >
                        <AccountCircle />
                    </IconButton>
                    <Menu
                        id="menu-appbar"
                        anchorEl={anchorEl}
                        anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
                        keepMounted
                        transformOrigin={{ vertical: 'top', horizontal: 'right' }}
                        open={isMenuOpen}
                        onClose={handleMenuClose}
                    >
                        <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
                        <MenuItem onClick={handleMenuClose}>My account</MenuItem>
                    </Menu>
                </Toolbar>
            </AppBar>
            <Drawer
                variant="permanent"
                sx={{
                    width: sidebarOpen ? 240 : 60,
                    flexShrink: 0,
                    '& .MuiDrawer-paper': {
                        width: sidebarOpen ? 240 : 60,
                        boxSizing: 'border-box',
                        overflowX: 'hidden', // Hide text when sidebar is closed
                        backgroundColor: '#fefee2', // Matching AppBar color
                    },
                }}
                open={sidebarOpen}
            >
                <List>
                    {menuItems.map((item, index) => (
                        <ListItem button key={item.text} onClick={item.onClick}>
                            <ListItemIcon>{item.icon}</ListItemIcon>
                            {sidebarOpen && <ListItemText primary={item.text} />}
                            {item.text === 'Top Stocks' && sidebarOpen && <ExpandMoreIcon />}
                        </ListItem>
                    ))}
                </List>
            </Drawer>
            <Menu
                id="top-stocks-menu"
                anchorEl={topStocksMenu}
                open={isTopStocksOpen}
                onClose={handleMenuClose}
                MenuListProps={{
                    'aria-labelledby': 'top-stocks-button',
                }}
            >
                <MenuItem onClick={handleMenuClose}>Option 1</MenuItem>
                <MenuItem onClick={handleMenuClose}>Option 2</MenuItem>
            </Menu>
            <Box component="main" sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${sidebarOpen ? 240 : 60}px)` } }}>
                {children}
            </Box>
        </Box>
    );
};

export default Layout;
